import '../css/navbar.css';


export default function Navbar(props)
{
    const {handleSendReq,formRef,handleLogout,acceptPartner,acceptRef} = props;
    

    return<div className="nav-div">
        
        <form onSubmit={handleSendReq} ref={formRef}>
        <input type="text" id="reqId" name="reqId"/>
        <input type="submit"/>
        </form>
        <input type="submit" value="logout" onClick={handleLogout}/>

        <form onSubmit={acceptPartner} ref={acceptRef}>
        <input type="text" id="reqId" name="senderId"/>
        <input type="submit"/>
        </form>
        
    </div>
}
